import axios from "axios";
import React, { useState } from "react";
import Button from 'react-bootstrap/Button';
import Alert from 'react-bootstrap/Alert';

const NewUser = () => {
    const [username, setUsername] = useState("");
    const [password, setPassword] = useState("");
    const [email, setEmail] = useState("");
    const [fullname, setFullname] = useState("");
    const [address, setAddress] = useState("");
    const [phone, setPhone] = useState("");
    const [role, setRole] = useState("");
    const [error, setError] = useState("");
    const [success, setSuccess] = useState("");

    const addUserHandler = async (event) => {
        event.preventDefault(); // Prevent the default form submission
        setError(""); // Clear previous error messages
        setSuccess(""); // Clear previous success messages

        // Basic validation
        if (!username || !password || !email || !fullname || !address || !phone || !role) {
            setError("All fields are required.");
            return;
        }

        try {
            const response = await axios.post(`http://localhost:10101/admin`, {
                username,
                password,
                email,
                fullname,
                address,
                phone,
                role
            });
            setSuccess("User added successfully!");
            // Optionally reset the form fields
            setUsername("");
            setPassword("");
            setEmail("");
            setFullname("");
            setAddress("");
            setPhone("");
            setRole("");
        } catch (error) {
            setError("Error adding user: " + (error.response?.data?.message || error.message));
        }
    }

    return (
        <>
            <div className="container p-4" style={{marginTop: '100px'}}>
                <div className="row p-auto m-auto">
                    <div className="col-12 text-center fw-bolder">
                        <h4>ADD USER</h4>
                    </div>
                    <div className="col p-4">
                        {error && <Alert variant="danger">{error}</Alert>}
                        {success && <Alert variant="success">{success}</Alert>}
                        <form onSubmit={addUserHandler}>
                            <div className="mb-3">
                                <label htmlFor="username" className="form-label">User Name</label>
                                <input className="form-control" type="text" id="username" required value={username} onChange={(e) => setUsername(e.target.value)} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="password" className="form-label">Password</label>
                                <input className="form-control" type="password" id="password" required value={password} onChange={(e) => setPassword(e.target.value)} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="email" className="form-label">Email</label>
                                <input className="form-control" type="email" id="email" required value={email} onChange={(e) => setEmail(e.target.value)} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="fullname" className="form-label">Full Name</label>
                                <input className="form-control" id="fullname" type="text" required value={fullname} onChange={(e) => setFullname(e.target.value)} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="address" className="form-label">Address</label>
                                <input className="form-control" id="address" type="text" required value={address} onChange={(e) => setAddress(e.target.value)} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="phone" className="form-label">Phone</label>
                                <input className="form-control" id="phone" type="tel" required value={phone} onChange={(e) => setPhone(e.target.value)} />
                            </div>
                            <div className="mb-3">
                                <label htmlFor="role" className="form-label">Role</label>
                                <select className="form-select" id="role" required value={role} onChange={(e) => setRole(e.target.value)}>
                                    <option value="">Choose option</option>
                                    <option value="admin">Admin</option>
                                    <option value="manager">Manager</option>
                                    <option value="driver">Driver</option>
                                    <option value="dataman">Dataman</option>
                                </select>
                            </div>
                            <div className="d-grid gap-2 mt-4">
                                <Button variant="dark" type="submit" className="py-1" size="lg">
                                    New +
                                </Button>
                            </div>
                        </form>
                    </div>
                </div>
            </div>
        </>
    );
}

export default NewUser;
